import React from 'react';
import sdata from './Sdata';
import Cards from './cards'

const favS = prompt("Enter your Fav series");

const App = () => (
    <>
    <h1 className="heading">List of Best Five Netflix Webseries</h1>
     {sdata.map((val) =>{
        return (
       <Cards 
       key={val.id}
       imgsrc={val.imgsrc}
       title={val.title}
       sname={val.sname}
       links={val.links}
       />    
     ) 
     })}

    </>
);

export default App;
